            url: "noticias/noticia1",
        },
        {
            title: "Noticia 3",
            url: "noticias/noticia1",
        },
    ];

    return (
        <>
            <div><Header /></div>
            <div className="menu">
                <h2>Men√∫ de Noticias</h2>
                <ul>
                    {newsLinks.map((link, index) => (
                        <li key={index}>
                            <a href={link.url} target="_blank" rel="noopener noreferrer">
                                {link.title}
                            </a>
                        </li>
                    ))}
                </ul>
            </div>
            <div><Footer/></div>
        </>
    );
};

export default Menu;
